import React, { useEffect } from 'react';

function DomDemo() {
  useEffect(() => {
    const el = document.getElementById('dom-target');
    el.style.color = 'blue';
    el.textContent = 'This text was changed with plain JavaScript!';
  }, []);

  return (
    <div>
      <h1>DOM Manipulation Page</h1>
      <p id="dom-target">Original Text</p>
    </div>
  );
}

export default DomDemo;
